 the John F. Kennedy International Airport is about 20 kilometres.',NULL,2),(91,'When will the route begin its service?','The nonstop Mumbai to JFK International Airport, New York flight begins its operation on 14 Feb 2023. You can now plan for an exciting Valentine\'s Day trip with your loved one to New York with our flight to JFK\n',NULL,1),(92,'How far is Chhatrapati Shivaji International Airport from downtown Mumbai?','Downtown Mumbai is 20 km from Chhatrapati Shivaji International Airport.',NULL,2),(93,'When will the route begin its service?','The nonstop Mumbai to JFK International Airport, New York flight begins its operation on 14 Feb 2023. You can now plan for an exciting Valentine\'s Day trip with your loved one to New York with our flight to JFK',NULL,1);
