INSERT INTO `components_airport_airportinformations` VALUES (1,'Indira Gandhi International Airport','One of the busiest airports in the INDIA is Indira Gandhi International Airport. The airport operates domestic and international flights. Birmingham Airport\'s current terminal complex is made up of a single enormous terminal that was connected by the Millennium Link between Terminals 1 and 2. The efficient public transportation system of rail, buses, metro, and taxis connects the airport to the city.'),(2,'Birmingham Airport','One of the busiest airports in the UK is Birmingham Airport. The airport operates domestic and international flights. Birmingham Airport\'s current terminal complex is made up of a single enormous terminal that was connected by the Millennium Link between Terminals 1 and 2. The efficient public transportation system of rail, buses, metro, and taxis connects the airport to the city.'),(3,'Birmingham Airport','One of the busiest airports in the UK is Birmingham Airport  the airport operates domestic and international flights. Birmingham Airport\'s current terminal complex is made up of a single enormous terminal that was connected by the Millennium Link between Terminals 1 and 2. The efficient public transportation system of rail, buses, metro, and taxis connects the airport to the city. '),(4,'Indira Gandhi International Airport','The major tourism and business destination of Delhi and the National Capital Region is served by the Indira Gandhi International Airport. It is the busiest and largest airport in India with regard to passenger traffic, ranking as the ninth-largest airport in the world. The airport is frequently used by passengers for both domestic and international travel. Delhi is connected to several significant cities around the world through the international terminal of the airport, Terminal 3.'),(7,'Indira Gandhi International Airport','The major tourism and business destination of Delhi and the National Capital Region is served by the Indira Gandhi International Airport. It is the busiest and largest airport in India with regard to passenger traffic, ranking as the ninth-largest airport in the world. The airport is frequently used by passengers for both domestic and international travel. Delhi is connected to several significant cities around the world through the international terminal of the airport, Terminal 3.'),(8,'Birmingham Airport','One of the busiest airports in the UK is Birmingham Airport  the airport operates domestic and international flights. Birmingham Airport\'s current terminal complex is made up of a single enormous terminal that was connected by the Millennium Link between Terminals 1 and 2. The efficient public transportation system of rail, buses, metro, and taxis connects the airport to the city. '),(9,'Birmingham Airport','Birmingham is one of the busiest airports in the UK. Various domestic and international flights fly\nthrough the airport. The Millennium Link connects Terminal 1 and Terminal 2 of the airport to create\nthe single largest terminal at Birmingham Airport&#39;s terminal complex. The airport is connected to the\ncity by a seamless public transportation network of Rail, Buses, Metro and Cabs.'),(10,'Sri Guru Ram Das Jee International Airport','With over 100 domestic and international flights every day, the Amritsar airport is one of the biggest in Northern India. The airport\'s capacity was increased with the addition of a new terminal, which opened in 2009, and its services were modernised as a result. During peak hours, the terminal has the capacity to accommodate 1200 passengers per hour, there are roughly 4 million passengers per year.'),(11,'Chicago O\'Hare International Airport','The primary international airport serving Chicago is the Chicago O\'Hare International Airport. 242 locations throughout North America, South America, the Caribbean, Europe, Africa, Asia, the Middle East, Oceania, and the North Atlantic region are serviced by non-stop flights from O\'Hare. The airport is regarded as being the most linked airport in the world  it has 191 gates and 4 terminals. An airport transit system is available to aid travellers in navigating the facility.'),(12,'Indira Gandhi International Airport','The Indira Gandhi International Airport serves the popular business and tourist destinations  Delhi and the National Capital Region (NCR). Many people use the airport to travel both domestically and internationally. As the eighth-biggest airport in the world, it is the busiest and largest airport in India with regard to passenger traffic. The airport\'s international terminal - Terminal 3, connects Delhi to some of the major cities around the globe.'),(13,'The San Francisco International Airport','San Francisco International Airport is located in an unincorporated area of San Mateo County. It has flights going throughout North America and is a major gateway to Europe, the Middle East, Asia, and Australia. It is the largest airport in the San Francisco Bay Area and the second-busiest in California. The airport has four terminals with a total of 115 gates. The International Terminal at San Francisco International Airport is the largest international terminal in North America.'),(14,'Indira Gandhi International Airport','The Indira Gandhi International Airport serves the popular business and tourist destinations  Delhi and the National Capital Region (NCR). Many people use the airport to travel both domestically and internationally. As the eighth-biggest airport in the world, it is the busiest and largest airport in India with regard to passenger traffic. The airport\'s international terminal - Terminal 3, connects Delhi to some of the major cities around the globe.'),(15,'Indira Gandhi International Airport','The Indira Gandhi International Airport serves Delhi and the National Capital Region which is a leading commercial and tourist destination in India. Passengers commonly travel domestically and internationally using the airport. In terms of passenger volume, it is the busiest and biggest airport in India and the ninth-largest airport in the world. The international terminal of the airport, Terminal 3, connects Delhi to a number of key cities throughout the globe.\n'),(17,'Toronto Pearson International Airport','The Toronto Pearson Airport serves the Golden Horseshoe, a territory that includes Toronto, its metropolitan area, and its surroundings. Several domestic airlines flying out of Pearson connect Toronto to all major and many secondary cities across Canada. Terminals 1 and 3 are the two operational public terminals of Toronto Pearson International Airport. Domestic, transborder, and international travel can all be accommodated by either terminal without any distinctions  in 2019, the airport handled 50.5 million passengers.'),(18,'IGI Airport','The Indira Gandhi International Airport serves the popular business and tourist destination of New Delhi and the National Capital Region (NCR). Many people use the airport to travel both domestically and internationally. As the eighth-biggest airport in the world, it is the busiest and largest airport in India in terms of passenger traffic. The airport\'s international terminal, Terminal 3, connects New Delhi to some of the major cities around the globe.'),(21,'Melbourne Airport','Melbourne Airport, the second busiest airport in Australia and the main airport supporting the city of Melbourne. There are four terminals at the airport: one international, two domestic, and one budget domestic. Direct flights are offered from the airport linking 33 domestic locations and to destinations in the Pacific, Europe, Asia, North America, and South America. Melbourne Airport is the primary arrival/departure point for flights linking four of Australia\'s seven capital cities.'),(22,'Indira Gandhi International Airport','The Indira Gandhi International Airport serves the popular business and tourist destination of New Delhi and the National Capital Region (NCR). Many people use the airport to travel both domestically and internationally. As the eighth-biggest airport in the world, it is the busiest and largest airport in India in terms of passenger traffic. The airport\'s international terminal, Terminal 3, connects New Delhi to some of the major cities around the globe.'),(23,'IGI International Airport','Indira Gandhi International Airport provides service to Delhi and National Capital Region which are primary tourist and commercial hubs in North India. Passengers commonly use the airport for both domestic and foreign travel. It is the ninth-biggest airport in the world and the busiest and largest airport in India in terms of passenger traffic. Through the international terminal of the airport, Terminal 3, Delhi is connected to a number of key cities all over the world.\n'),(24,'John F. Kennedy International Airport','New York City is serviced by John F. Kennedy International Airport. It is the busiest international air passenger gateway into North America and 13th busiest airport in the United States. The airport is serviced by more than 90 airlines, offering flights across the globe. The airport has four runways and six passenger terminals to cater to a large number of passengers.\n'),(25,'Indira Gandhi International Airport','The Indira Gandhi International Airport serves Delhi and the National Capital Region, which is a major tourist and commercial destination. The airport is extensively used by travellers for both domestic and international travel. In terms of passenger volume, it is the busiest and largest airport in India and ranks ninth in the world. The international terminal of the airport, Terminal 3, connects Delhi to several significant cities throughout the world. \n'),(26,'Sydney Kingsford Smith Airport','Sydney Kingsford Smith Airport is one of the world\'s longest continuously operated commercial airports and is the busiest airport in Australia. In 2016- 2017 the airport saw 42.6 million passengers and 348,904 aircraft movements. It was the 38th busiest airport in the world in 2016. Currently, the airport connects 46 domestic and 43 international destinations. The airport has three passenger terminals where two are domestic terminals and one is an international terminal. The International Terminal is separated by a runway; therefore, passengers connecting from other terminals need to consider the longer transfer times.\n'),(27,'SFO International Airport','The San Francisco International Airport is situated in an unincorporated region of San Mateo County. It serves all of North America with flights and serves as a key entry point for travel to Europe, the Middle East, Asia, and Australia. It is the second-busiest airport in California and the major airport in the San Francisco Bay Area. Four terminals and 115 gates make up the airport. The biggest international terminal in North America is located at San Francisco International Airport.\n'),(28,'Chhatrapati Shivaji International Airport','The Chhatrapati Shivaji International Airport in Mumbai is one of the busiest airports in India. Mumbai is connected to 43 key worldwide locations through the airport. About 40 airlines are based in Terminal 2 of the airport alone. The international terminal is recognised for its stunning, cutting-edge design. \n'),(29,'SFO International Airport','The San Francisco International Airport is situated in an unincorporated region of San Mateo County. It serves all of North America with flights and serves as a key entry point for travel to Europe, the Middle East, Asia, and Australia. It is the second-busiest airport in California and the major airport in the San Francisco Bay Area. Four terminals and 115 gates make up the airport. The biggest international terminal in North America is located at San Francisco International Airport.\n'),(30,'Kempegowda International Airport','Kempegowda International Airport serves Bengaluru, the capital of Karnataka, India. The airport opened in May 2008 as a replacement for the city\'s original principal commercial airport, HAL Airport, which had become more congested. The airport is Karnataka\'s first completely solar-powered airport. There are two runways and one passenger terminal at the airport, which manages both domestic and international operations. With 27 international connections, Kempegowda International Airport is the busiest airport in South India.\n'),(31,'SFO International Airport','The San Francisco International Airport is situated in an unincorporated region of San Mateo County. It serves all of North America with flights and serves as a key entry point for travel to Europe, the Middle East, Asia, and Australia. It is the second-busiest airport in California and the major airport in the San Francisco Bay Area. Four terminals and 115 gates make up the airport. The biggest international terminal in North America is located at San Francisco International Airport.\n'),(32,'SFO International Airport','San Francisco International Airport is located in the unincorporated territory of San Mateo County. It provides flights to all parts of North America and serves as a crucial entry point for travel to Europe, the Middle East, Asia, and Australia. It is the primary airport serving the San Francisco Bay Area and the second busiest airport in California. The airport has 115 gates and four terminals. San Francisco International Airport has North America\'s largest international terminal.\n'),(33,'Kempegowda International Airport','Bangalore is served by Kempegowda International Airport. The airport opened in May 2008 to replace HAL Airport, the city\'s former main commercial airport. The airport is Karnataka\'s first entirely solar-powered facility. The airport has two runways and one passenger terminal that handles both domestic and international flights. Kempegowda International Airport is the busiest airport in South India, with 27 international connections.\n'),(34,'SFO International Airport','San Francisco International Airport is located in the unincorporated territory of San Mateo County. It provides flights to all parts of North America and serves as a crucial entry point for travel to Europe, the Middle East, Asia, and Australia. It is the primary airport serving the San Francisco Bay Area and the second busiest airport in California. The airport has 115 gates and four terminals. San Francisco International Airport has North America\'s largest international terminal.\n'),(35,'Chhatrapati Shivaji International Airport','Among the biggest aviation hubs in India is Mumbai\'s Chhatrapati Shivaji International Airport. 43 significant international locations are connected to Mumbai via the airport. The airport\'s Terminal 2 is home to about 40 airlines. The spectacular, cutting-edge architecture of the international terminal is renowned.\n'),(36,'SFO International Airport','San Francisco International Airport is located in the unincorporated territory of San Mateo County. It provides flights to all parts of North America and serves as a crucial entry point for travel to Europe, the Middle East, Asia, and Australia. It is the primary airport serving the San Francisco Bay Area and the second busiest airport in California. The airport has 115 gates and four terminals. San Francisco International Airport has North America\'s largest international terminal.\n'),(37,'Indira Gandhi International Airport','A major tourist and business destination, Delhi and the National Capital Region are serviced by the Indira Gandhi International Airport. The airport is frequently used by passengers for both domestic and international travel. It is the busiest and largest airport in India in terms of passenger traffic, ranking as the ninth-largest airport in the entire globe. Delhi is connected to several significant cities throughout the world through the international terminal of the airport, Terminal 3.\n'),(38,'Chicago O\'Hare International Airport','The primary international airport serving Chicago is the Chicago O\'Hare International Airport. 242 locations throughout North America, South America, the Caribbean, Europe, Africa, Asia, the Middle East, Oceania, and the North Atlantic region are serviced by non-stop flights from O\'Hare. The airport is regarded as being the most linked airport in the world  it has 191 gates and 4 terminals. An airport transit system is available to aid travellers in navigating the facility.'),(39,'Indira Gandhi International Airport','The Indira Gandhi International Airport serves the popular business and tourist destination of Delhi and the National Capital Region (NCR). Many people use the airport to travel both domestically and internationally. As the eighth-biggest airport in the world, it is the busiest and largest airport in India in terms of passenger traffic. The airport\'s international terminal, Terminal 3, connects Delhi to some of the major cities around the globe.\n'),(40,'Indira Gandhi International Airport','India\'s top commercial and tourism destinations, Delhi and the National Capital Region are served by the Indira Gandhi International Airport. The airport is frequently used by passengers for both domestic and international travel. It is the ninth-largest airport in the world and the busiest and largest airport in India in terms of passenger volume. The international facility of the airport, Terminal 3, links Delhi to several significant cities throughout the world. '),(41,'John F. Kennedy International Airport','John F. Kennedy International Airport serves New York City as its primary international airport. The airport is the 13th busiest airport in the US and the busiest gateway for international flight travelers into North America. With flights to destinations on all six inhabited continents, the airport is served by more than 90 airlines. Six passenger terminals and four runways allow the airport to handle a huge volume of travelers.'),(42,'Birmingham Airport','Birmingham serves as a significant air travel hub for the UK. Many domestic and foreign aircraft use the airport as their hub. The Terminal 1 and Terminal 2 buildings at Birmingham Airport are connected by the Millennium Link through a single, large terminal. These buildings are on different sides of the airport. The airport is connected to the city by a reliable public transit network made up of trains, buses, the metro, and taxis.\n'),(43,'Indira Gandhi International Airport','The Indira Gandhi International Airport serves Delhi and the National Capital Region as a top commercial and tourist destination. In terms of passenger volume, it is the busiest and biggest airport in India and the ninth-largest airport in the world. Passengers commonly travel domestically and internationally using the airport. The international terminal of the airport, Terminal 3, connects Delhi to many key cities throughout the globe.\n'),(44,'Birmingham Airport','A major hub for air travel in the UK is Birmingham. The airport is a centre for several domestic and international aircraft. Birmingham Airport\'s current terminal complex is made up of a single, enormous terminal that connects Terminals 1 and 2, which are located on opposite sides of the airport with the Millennium Link. A consistent public transportation system that includes trains, buses, metro, and taxis connects the airport to the city.'),(45,'Sri Guru Ram Das Ji International Airport / Amritsar International Airport','The Amritsar airport is one of the biggest in Northern India, with more than 100 domestic and international flights per day. The new terminal, which debuted in 2009, boosted the airport\'s capacity while also modernising its services. There is room for 1200 passengers per hour at the terminal during peak times. The annual passenger volume is about 4 million.\n'),(46,'Indira Gandhi International Airport','Delhi Airport is the largest and busiest airport in India. It is operated by Delhi International Airport Ltd (DIAL). The airport has five terminals: Terminals 1, 2 and 3 are international, while Terminal 4 handles domestic flights only. Being the capital city, the airport is at the heart of air travel connecting locally and globally. \n'),(47,'Heathrow Airport','London Heathrow Airport is London\'s largest airport and the third busiest in Europe. The airport has three terminals; the two older terminals are Terminal 1 and Terminal 2, while Terminal 3 opened in June 2018. It has more than 45 separate airlines operating flights from Heathrow, 23 of which are international airlines to 177 destinations across 50 countries, with over 60 scheduled daily departures. \nThe airport handles about 100 million passengers a year with over 80 airline companies using Heathrow and has 60 other airlines using its heliport or private aviation every year.\n'),(48,'Sardar Vallabhai Patel International Airport ','Ahmedabad now houses 2 airports like other top Indian cities like Mumbai and Delhi. The construction for terminal 2 is completed, and more flights can fly in and to Ahmedabad easily. Air India is proud to be a key contributor to this by adding many domestic and international flights, including the 2 for London. \n'),(49,'Heathrow Airport','Being the busiest airport in the UK, London Heathrow Airport is always buzzing with activity no matter which part of the day you visit it. Millions of travellers fly each week through this airport and it is said to be where east and west connect. It offers all world-class services from multiple 5-star lounges to a forex exchange.\n'),(50,'Sri Guru Ram Das Ji International Airport ','Located in the heart of Punjab, Amritsar Airport is one of the finest airports in India. While it is smaller than most international airports in India, it offers world-class services. Spread over 40,000 sq metres it has 30 check-in counters and 26 immigration counters. It has a limited number of international flights and Air India is proud to introduce new flights for its route to London. '),(51,'Heathrow Airport','London Heathrow International Airport is the 3rd busiest airport in Europe. It has 5 terminals to meet the demand of growing fliers. It serves 203 destinations across 84 countries. \nHeathrow Airport has two terminals: Terminal 1 (T1), launched in 1938; Terminal 2 (T2), which opened in 1995 after being initially planned as part of an expansion project to increase capacity beyond what had been available at T1.\n'),(52,'Heathrow International Airport','London Heathrow Airport is the largest and busiest airport in Europe. It is owned by BAA (the British Airports Authority) which operates it under a concession contract with the Government of Britain.\nIt was opened on Monday 29 May 1946 as a civil airport after World War II and has grown over time to become one of Europe\'s largest airports with a total annual passenger throughput exceeding 150 million passengers per year as well as handling cargo traffic from all over the world. Heathrow Airport has two terminals: Terminal 1 (T1), launched in 1938; Terminal 2 (T2), which opened in 1995 after being initially planned as part of an expansion project to increase capacity beyond what had been available at T1.\n'),(53,'Cochin International Airport ','Cochin airport is smaller than other International airports in India. However, with the growing no. of international travellers, the airport is now expanding and welcoming more international flights. Moreover, it offers services like smoking zones, prayer rooms, medical assistance, foreign exchange, stroller assistance for babies and more. \n'),(54,'Heathrow Airport ','London Heathrow Airport is London\'s largest airport and the third busiest in Europe. The airport has three terminals; the two older terminals are Terminal 1 and Terminal 2, while Terminal 3 opened in June 2018. It has more than 45 separate airlines operating flights from Heathrow, 23 of which are international airlines to 177 destinations across 50 countries, with over 60 scheduled daily departures. \nThe airport handles about 100 million passengers a year with over 80 airline companies using Heathrow and has 60 other airlines using its heliport or private aviation every year.\n'),(55,'Goa International Airport','Goa International Airport, also known as Dabolim International Airport, services a large traffic of both inbound and outbound passengers. This airport is smaller than other International airports in India. However, with the growing number of international travellers, the airport is now expanding and welcoming more global flights. Several European charter airlines fly to Goa seasonally, typically between November and May.  It offers services like smoking zones, prayer rooms, medical assistance, forex exchange, stroller assistance for babies and more. '),(56,'Heathrow Airport','London Heathrow Airport\nLondon Heathrow Airport is London\'s largest airport and the third busiest in Europe. The airport has three terminals; the two older terminals are Terminal 1 and Terminal 2, while Terminal 3 opened in June 2018. It has more than 45 separate airlines operating flights from Heathrow, 23 of which are international airlines to 177 destinations across 50 countries, with over 60 scheduled daily departures. \nThe airport handles about 100 million passengers a year with over 80 airline companies using Heathrow and has 60 other airlines using its heliport or private aviation every year over 3 billion people on all continents from 0 to 80.\n'),(57,'Chhatrapati Shivaji Maharaj International Airport','International flights fly from Terminal 2 of Chhatrapati Shivaji Maharaj International Airport. Operated by Adani Group, the airport is a state-of-art facility that houses multiple restaurants and lounges, shopping areas and play area for kids.'),(58,'Heathrow Airport','London Heathrow Airport is London\'s largest airport and the third busiest in Europe. The airport has three terminals; the two older terminals are Terminal 1 and Terminal 2, while Terminal 3 opened in June 2018. It has more than 45 separate airlines operating flights from Heathrow, 23 of which are international airlines to 177 destinations across 50 countries, with over 60 scheduled daily departures. \nThe airport handles about 100 million passengers a year with over 80 airline companies using Heathrow and has 60 other airlines using its heliport or private aviation every year.\n'),(59,'Indira Gandhi International Airport','Delhi Airport is the largest and busiest airport in India. It is operated by Delhi International Airport Ltd (DIAL). The airport has five terminals: Terminals 1, 2 and 3 are international, while Terminal 4 handles domestic flights only. Being the capital city, the airport is at the heart of air travel connecting locally and globally. \n'),(60,'Sri Guru Ram Das Ji International Airport','With over 100 domestic and international flights every day, the Amritsar airport is one of the biggest in Northern India. The airport\'s capacity was increased and modernised with a new terminal, which opened in 2009. During peak hours, the terminal has a capacity to accommodate 1200 passengers per hour, there are roughly 4 million passengers per year.'),(61,'Birmingham Airport','Birmingham is one of the busiest airports in the UK. Various domestic and international flights fly through the airport. The Millennium Link connects Terminal 1 and Terminal 2 of the airport to create the single largest terminal at Birmingham Airport\'s terminal complex.  The airport is connected to the city by a seamless public transportation network of Rail, Buses, Metro and Cabs.'),(62,NULL,NULL),(63,'JFK International Airport','John F. Kennedy International Airport is the most significant international airport that serves New York City. The airport is the 13th busiest airport in the United States and the busiest foreign air passenger gateway into North America. More than 90 airlines operate flights from the airport to destinations on each of the six inhabited continents. The airport can accommodate a significant number of passengers thanks to its six passenger terminals and four runways.\n'),(64,'Chhatrapati Shivaji International Airport','One of the busiest airports in India is the Chhatrapati Shivaji International Airport in Mumbai. It manages roughly 950 aircraft movements each day and has two operational terminals that are dispersed over a total of 750 hectares of land. Due to this airport\'s nonstop or connecting flights to all six inhabited continents, Mumbai is connected to 43 important global locations. Nearly 40 airlines have bases in the airport\'s Terminal 2. The international terminal is renowned for its magnificent, modern appearance.\n\n'),(65,'Chhatrapati Shivaji International Airport','One of the busiest airports in India is the Chhatrapati Shivaji International Airport in Mumbai. It manages roughly 950 aircraft movements each day and has two operational terminals that are dispersed over a total of 750 hectares of land. Due to this airport\'s nonstop or connecting flights to all six inhabited continents, Mumbai is connected to 43 important global locations. Nearly 40 airlines have bases in the airport\'s Terminal 2. The international terminal is renowned for its magnificent, modern appearance.'),(66,'JFK International Airport ','John F. Kennedy International Airport is the most significant international airport that serves New York City. The airport is the 13th busiest airport in the United States and the busiest foreign air passenger gateway into North America. More than 90 airlines operate flights from the airport to destinations on each of the six inhabited continents. The airport can accommodate a significant number of passengers thanks to its six passenger terminals and four runways.\n\n\n');
