INSERT INTO `ongoingpromos` VALUES (1,'ongoing promotion','del-bhx','2022-10-19 10:44:21.686000','2022-11-18 12:03:45.588000','2022-10-26 09:27:10.665000',5,2,'Connecting Delhi to Birmingham','Flying Air India','\n<p>Air India is one of the premier airlines, with a network spanning across USA, Canada, UK, Europe, Far East, south-east Asia, Australia and the Gulf. Being a Star Alliance member, travelers can access 26 foreign airlines loyalty programmes that are linked with ours. </p>\n<br/>\n<p>Air India will be operating weekly flights to connect New Delhi (India) with Birmingham (England) for better connectivity and accommodating growing traffic. Three new frequencies will be added to the roster to service this route, with two flights starting from 02nd October 2022 and the third flight will be added on 16th November 2022. These additions are in lieu of restoring Air Indias leadership  position in the field of international aviation. </p>\n<br/>\n<p>Air India is also bringing back wide-body and narrow-body aircrafts, in addition to leasing new ones to ensure stronger connectivity for journeys to global destinations and international events. With our flights, travellers can also expect crew members to converse in Indian languages, allowing seamless and easy conversations to make your journey memorable. </p>\n\n','Experience the best of Birmingham','With our dependable service, you can travel and see everything that Birmingham has for tourists. The Venice of the UK has a lot to offer visitors, whether you are looking for culture, adventure, or just a singular experience. ','Air India offers outstanding services for Indian travellers','  <h2 className=\"font-[Montserrat] leading-10 font-semibold text-[#585B5C] text-center text-[41px] pb-5 mb-[20px] sms:text-[24px] sms:leading-8\">\n   Air India offers<br /> outstanding services for Indian travellers\n            </h2>','Airport Information','Delhi','del','Birmingham','bhx','One of the most popular cities in England is Birmingham, is a favourite amongst tourists. Numerous historical sites and monuments, attractive canals, museums, parks and gardens, shopping malls, walking tours, and enjoyable activities are all present in the city, which is also the site of numerous international sporting and cultural events. Tourists frequently choose local transportation. The Birmingham municipal public transportation system is organised by Transport for West Midlands. Birmingham is an important transportation centre on the highway, rail, and canal networks due to its strategic location in England. Cabs, buses, trams, and canals are readily available for tourists to use as they navigate the city.','The Birmingham Airport offers services like ','The Indira Gandhi Airport offers services like','<span>You can book tickets with Air India for your trip to Birmingham and decide what adventures you want to have there. Plan your trip to Birmingham by visiting </span>\n<a \nhref=\'https://visitbirmingham.com/\'>https://visitbirmingham.com/  </a>','IN',NULL),(4,'ongoing promotion','del-ord','2022-10-21 11:40:18.109000','2022-11-14 08:04:25.494000','2022-10-25 08:03:49.501000',4,2,'Connecting Delhi to Chicago','Flying Air India','<p>Air India has started flying daily flights between New Delhi (India) and Chicago (USA), to meet the growing travel demands. The new flight provides travellers with convenient options for travel to Chicago with an extra day at their disposal. The support of Interline partner carriers and other airlines provides additional connectivity in the USA. These additions are in lieu of restoring Air Indias leadership  position in the field of international aviation.</p>\n<br/>\n<p>Air India is also bringing back wide-body and narrow-body aircraft in addition to leasing new ones to ensure more robust connectivity for Indian travelers to journey to global destinations and experience international events. With our flights, travelers can also expect crew members to converse in Indian languages, allowing seamless and easy conversations to make your journey better.</p>\n<br/>\n<p>Air India is one of the premier airlines, with a network that includes the USA, Canada, UK, Europe, Far East, south-east Asia, Australia, and the Gulf. Being a Star Alliance member, you can access 26 other foreign airlines\' loyalty programmes that are linked with ours.</p>\n','Experience the best of Chicago','With the help of our trustworthy and well-known services, you may travel to explore and take in everything that Chicago offers. The city has everything one could ask for, whether you\'re seeking culture, adventure or one-of-a-kind experience. Make the most of your trip by making it unforgettable.\nExperience the wonder of 360 Chicago Observation Deck, Cloud Gate, Millennium Park, Wrigley Field, The Magnificent Mile, Chicago Riverwalk and much more.\nGet acquainted with the culture at Chicago Cultural Center, Garfield Park Conservatory, The Art Institute of Chicago, Museum of Science and Industry, Field Museum, Chicago History Museum, etc.\nHave some fun at the Lincoln Park Zoo, Shedd Aquarium, Maggie Daley Park, Navy Pier, etc.\nShop your heart out at Water Tower Place, Merchandise Mart, French Market and much more.\nUse the trustworthy flight services of Air India to experience the best of Chicago. You may plan your travels in Chicago with the help of https://www.choosechicago.com/','Air India offers outstanding services for Indian travellers','\n   <h2 className=\"font-[Montserrat] leading-10 font-semibold text-[#585B5C] text-center text-[41px] pb-5 mb-[20px] sms:text-[24px] sms:leading-8\">\n   Air India offers<br /> Delicious in-flight meals with options for Indian meals.\n           </h2>','Airport Information','Delhi','del','Chicago','ord','Chicago epitomizes the principles of America\'s heartland  integrity, hard labour and community\nwhich reflects these ideas in the social fabric of its diverse neighbourhoods. Chicago is a\nmulticultural metropolis that flourishes with the harmony and diversity of its people. The city has\na robust transportation system through which travellers can explore its nooks and corners. For\nthose looking for an exceptional vacation, Chicago has a lot to recommend.','The Chicago O\'Hare International Airport offers services like','The Indira Gandhi Airport offers services like','<span>Use the trustworthy flight services of Air India to experience the best of Chicago. You may plan your travels in Chicago with the help of <span> <a href=\'https://www.choosechicago.com/\'>https://www.choosechicago.com/</a>\n',NULL,NULL),(6,'Air India: Connecting San Francisco to Delhi','sfo-del','2022-10-25 08:51:40.119000','2022-11-18 11:20:55.154000','2022-10-25 09:34:10.257000',4,2,'Connecting San Francisco to Delhi','Flying Air India','<p> Air India has introduced daily flights between Delhi (India) and San Francisco (USA) to meet the growing travel demands. Travelling to San Francisco and partaking in everything that the city has to offer, is comfortably possible for travellers now. In addition to having an extra day at your disposal, you can also benefit from the additional connectivity within the USA provided by our partner airlines like Interline. These additions are in lieu of restoring Air Indias leadership position in the field of international aviation. </p> <br> <p>\nAir India is also bringing back wide-body and narrow-body aircraft in addition to leasing new ones to ensure more robust connectivity for Indian travellers to journey to global destinations and experience international events. With our flights, travellers can also expect crew members to converse in Indian languages, allowing seamless and easy conversations to make your journey memorable. </p> <br> <p>\nAir India is one of the premier airlines, with a network that includes the USA, Canada, UK, Europe, Far East, south-east Asia, Australia, and the Gulf. Being a Star Alliance member, you can access 26 other foreign airlines\' loyalty programmes