commence on 17th November 2022. These additions are in lieu of restoring Air Indias leadership position in the field of international aviation. </p> <br> <p>\nAir India is also bringing back wide-body and narrow-body aircrafts, in addition to leasing new ones to ensure stronger connectivity for journeys to global destinations and international events. With our flights, travellers can also expect crew members to converse in Indian languages, allowing seamless and easy conversations to make your journey memorable. </p> <br> <p>\n\nAir India is one of the premier airlines, with a network spanning across USA, Canada, UK, Europe, Far East, south-east Asia, Australia and the Gulf. Being a Star Alliance member, travelers can access 26 foreign airlines loyalty programmes that are linked with ours.\nThe connection between the culturally rich city of Amritsar and cosmopolitan Birmingham is not just a great trip but also a meaningful journey.  </p>','Experience the best of Birmingham','Embark on an unforgettable trip to Birmingham with Air India and explore a world of culture, adventure, or simply a unique experience that the Venice of UK has to offer. \nVisit the Birmingham Museum & Art Gallery, National Motorcycle Museum, Coffin Works, Museum of the Jewellery Quarter, Black Country Living Museum, West Midlands Police Museum and much more.\nSoak in the culture and literature at Symphony Hall, Library of Birmingham, Birmingham Hippodrome, International Convention Centre, National Exhibition Centre etc.\nExperience various offbeat activities like Birmingham Ghost Hunt: Haunted City Exploration Game, Birmingham City Centre Walking Tour, Birmingham Self-Guided Audio Tour and much more.\nStroll through historic sites and monuments in the city such as Birmingham Back to Backs, Winterbourne House and Garden, Aston Hall, Soho House, Blakesley Hall, the Birmingham Cathedral, Gas Street Basin, and many more amazing sights.\nCheck out water sports, boating and boat tours, parks and nature walks, casinos, amusement parks, Zoos, Aquariums, Spas, and a roaring nightlife. \nWith Air India, you can reserve your tickets for your trip to Birmingham and choose your adventure in the city.','Air India offers outstanding services for Indian travellers','\n   <h2 className=\"font-[Montserrat] leading-10 font-semibold text-[#585B5C] text-center text-[41px] pb-5 mb-[20px] sms:text-[24px] sms:leading-8\">\n   Air India offers<br /> outstanding services for Indian travellers\n            </h2>','Airport Information','Amritsar','atq','Birmingham','bhx','Birmingham is one of the most popular tourist destinations in England. There are numerous historical places & monuments, picturesque canals, museums, parks & gardens, shopping centres, walking tours and fun activities spread across the city. With many international sporting and cultural events happening in the city, one can immerse themselves into the citys offerings.\nThe Transport for West Midlands is in charge of organising the local public transportation system in Birmingham. Because of the citys central location in England, Birmingham serves as a significant transportation hub for the highways, rails, and canal networks  tourists can travel through the city in easily available cabs, buses, trams, and canals. ','The Birmingham Airport offers services like ','Key services offered at Amritsar Airport','<span>You can book tickets with Air India for your trip to Birmingham and decide what adventures you want to have there. Plan your trip to Birmingham by visiting </span><a href=\"https://visitbirmingham.com/\">https://visitbirmingham.com/</a> \n',NULL,NULL),(28,'ongoing promotion','bom-jfk','2022-11-16 05:02:31.136000','2022-11-22 06:45:18.717000','2022-11-16 05:21:14.600000',2,5,'Direct flights from Mumbai to New York','Flying Air India','<p>Air India is starting flying daily flights from Mumbai, India, to JFK International Airport, New York, USA, to accommodate the needs of Indian tourists. Indian travellers now have a fantastic choice for visiting New York and taking advantage of everything that the city has to offer thanks to the introduction of the new airline route. You will have a great travelling experience that is both convenient and comfortable with our one-of-a-kind nonstop flight linking Mumbai to JFK International Airport in New York. </p> <br> <p>\n\nThis is a part of Air India\'s systematic strategy to satisfy the needs of Indian travellers while reclaiming the top rank in the global aviation industry. This route has increased Air Indias presence at JKF airport to two daily flights, further strengthening Air Indias reputation as a premiere international flight option with 47 weekly flights and 7 daily flights to the US. With its latest attempt to connect India to the big apple, Air India now has 21 weekly flights from Mumbai to the two airports of New York, JFK International Airport and the Newark Liberty International Airport.\n </p> <br> <p>\nWhether on vacation or flying for business, we are aware of the needs of Indian tourists. The travel from Mumbai to New York has the potential to be the ideal beginning of an enlightening journey. Information on the flight between Mumbai and JFK International Airport may be found in the table below. </p>','Experience the best of New York','You can travel to New York to explore and take in everything the city has to offer its visitors with the help of our trustworthy and well-respected services. Whether you\'re looking for culture, adventure, or a one-of-a-kind experience, the city has it all. Make the most of your trip by ensuring that it is unforgettable with our premiere flying experience.  \n','Air India offers outstanding services for Indian travellers','  <h2 className=\"font-[Montserrat] leading-10 font-semibold text-[#585B5C] text-center text-[41px] pb-5 mb-[20px] sms:text-[24px] sms:leading-8\">\n   Air India offers<br /> outstanding services for Indian travellers\n            </h2>','Airport Information','Mumbai','bom','New York','jfk','New York City, one of the biggest US cities, is located in the east of the nation. It serves as the financial and commercial centre of America. The city was founded in the year 1624 by settlers from the Dutch Republic. It has a strong transportation network and is situated in a unique geographical location that makes it one of the major centres for business, industry, and finance in the entire world. Additionally, the city is one of the world\'s largest cultural hubs. New York has been dubbed \"The City That Never Sleeps\", due to its bustling life. All the pleasures that the beautiful metropolis has to offer can be thoroughly enjoyed on your visit.','The John F. Kennedy International Airport offers services like','The Mumbai Airport offers services like','<span>If you want to get the most out of your visit and experience New York to the fullest, use the reliable airline services of Air India. You can plan your travels in New York by visiting </span><a href=\"https://www.nycgo.com/ \">https://www.nycgo.com/ </a>\n',NULL,NULL),(29,'ongoing promotion','jfk-bom','2022-11-16 06:35:32.549000','2022-11-18 10:11:47.870000','2022-11-16 06:59:25.986000',8,2,'Connecting New York to Mumbai','Flying Air India','<p>To meet the demands of travellers looking to travel to India, Air India will start operating daily flights from JFK International Airport in New York, USA, to Mumbai, India. Thanks to the introduction of the new airline route, people now have a terrific option for travelling to Mumbai and enjoying everything the city has to offer. With our one-of-a-kind nonstop flight from JFK International Airport in New York to Mumbai, you will have an excellent travel experience that is viable and comfortable.</p><br/>\n\n<p>This is a result of Air India\'s systematic and objective plan to meet the needs of visitors to India and recapture the top spot in the international aviation market. Air India now operates two daily flights from JFK airport, thus enhancing its status as a top international airline provider with 47 weekly and 7 daily flights between the US and India. With its most recent effort to link New York City with India, Air India now operates 21 weekly flights between Mumbai and the two airports in New York CityJFK International Airport and Newark Liberty International Airportoffering a variety of travel opportunities to interested travellers.</p><br/>\n\n<p>We at Air India understand the demands of Indian travellers, whether they are flying for business or pleasure. The flight from New Yorks JFK International Airport to Mumbai has the potential to be the perfect start to an exciting journey to India.</p>','Experience the best of Mumbai','It is a pleasure to visit Mumbai with our services and take in all of its top attractions. By choosing our quick and effective service, you may fly to the city and enjoy all that Mumbai has to offer its visitors. Tourists looking for culture, excitement, or simply a unique experience will discover that the city has a lot to offer. You\'ll create lifelong memories when you visit the city.','Air India offers outstanding services for Indian travellers','<h2 className=\"font-[Montserrat] leading-10 font-semibold text-[#585B5C] text-center text-[41px] pb-5 mb-[20px] sms:text-[24px] sms:leading-8\">\n   Air India offers<br /> outstanding services for Indian travellers\n            </h2>','Airport Information','New York','jfk','Mumbai','bom','One of Indias largest and most populated cities in India is Mumbai. The city is famous as Indias entertainment and financial capital where the population is renowned for its intense vigour and active lifestyle. The colonial architecture in Mumbais central area is some of the best and most elegant in India yet if you explore some of the citys more obscure lanes, you will also find a variety of bazaars, temples, upmarket cafs, bustling beaches and extremely stunning nightlife. Around every corner in Mumbai, there is something to impress you. In this metropolis, there is a little something for everyone.','The Mumbai Airport offers services like','The John F. Kennedy International Airport offers services like','<span> For your journey to Mumbai, choose Air India for an amazing flying experience. We help you make the best start to your visit to India. Prepare for your trip to Mumbai by visiting </span> <a href=\" https://www.maharashtratourism.gov.in/ \"> https://www.maharashtratourism.gov.in/. </a> ',NULL,NULL);
