INSERT INTO `promotions` VALUES (1,'football promo','football-promo','football, world cup',0,'\n<p>The Hamad International Airport plays a big hand in the tourism industry 11.\nWhether you\'re arriving or departing, the airport offers world-class comfort, dining, and shopping experience. \nThe airport has particularly been renovated to accommodate the rush of passengers for the upcoming tournament. </p>','2022-09-23 10:00:08.440000','2022-10-11 04:47:18.718000','2022-09-23 10:00:11.177000',2,5,'FOOTBALL FANS, ARE YOU READY?\n','  Football fans, be a part of the action in Qatar.\n          <br />\n          Air India is introducing 20 new flights to Qatar every week. We will\n          fly from metro cities that includes <br />\n          Mumbai, Delhi, Hyderabad, and Chennai. The new flights will cater to\n          the football craze amongst the <br />\n          fans during the months of November and December 2022. See you in Doha.','THE HAMAD INTERNATIONAL AIRPORT, DOHA','Fly with us','<div class=\"max-w-4xl text-sm mx-auto\">\n                  <p>Air India has added 20 extra flights each week from major Indian cities, including Mumbai, Delhi, Hyderabad, and Chennai, to Doha, making it easier for Indians to travel to Qatar. You can now easily travel to Qatar to experience the events, activities, and culture that are taking place.\nThe additional flights will help meet the rising demand for flight tickets to Doha, an increasingly popular travel destination. Previously, we had increased the number of flights by 24 to boost connectivity to Doha.\n</p>\n<p class=\"mt-[10px]\">We strive to provide impeccable travel and hospitality services to all travellers from India. The flight schedule is created to make the entire journey simple and convenient for travellers.\nIn addition to the daily flights running from Delhi, the additional flights will connect India\'s major cities like Mumbai, Delhi, Chennai, and Hyderabad with Qatar\'s capital, Doha.\n\n</p>\n                </div>\n               \n<div class=\"flex justify-center w-full mx-auto my-[20px] flex-wrap\">\n \n <a  href=\"https://content.airindia.in/promotions/bom-doh\" class=\"mb-[15px] xs:max-w-[45%] min-h-[360px] bg-[#D9000D] text-white flex p-[10px] w-full mx-auto max-w-[250px] max-h-[360px] text-[white] bg-cover md:bg-center mx-[8px] md:bg-auto \" style=\"margin-bottom:15px\">\n   <div class=\" flex justify-center flex-col items-center\">\n     <p class=\"text-center\">\n     \n   <img src=\"/uploads/Mumbai_86e31ea773.png?updated_at=2022-10-06T04:59:38.449Z\" class=\"w-14\"/>\n     </p>\n     <p class=\"text-base font-semibold\">Mumbai</p>\n   \n    <p class=\"text-xs mt-3\"><spam class=\"font-semibold mb-[5px] flex justify-center\">13 weekly special flights</spam> from Mumbai, some of which run daily and others only available on specific days.</p>\n    </div>\n </a>\n\n <a   href=\"https://content.airindia.in/promotions/del-doh\" class=\"xs:max-w-[45%] min-h-[360px] bg-[#D9000D] text-white flex p-[10px] w-full mx-auto max-w-[250px] max-h-[360px] text-[white] bg-cover md:bg-center mx-[8px] md:bg-auto\">\n   <div class=\" flex justify-center flex-col items-center\">\n     <p class=\"text-center\">\n       \n   <img src=\"/uploads/Delhi_c3d52e41d2.png?updated_at=2022-10-06T04:59:38.428Z\" class=\"w-14\"/>\n     </p>\n     <p class=\"text-base font-semibold\">Delhi</p>\n   \n    <p class=\"text-xs mt-3\"><spam class=\"font-semibold mb-[5px] flex justify-center\">14 weekly special flights</spam>from Delhi, with different flights running on different days.</p>\n    </div>\n </a>\n \n \n <a href=\"https://content.airindia.in/promotions/hyd-doh\" class=\"xs:max-w-[45%] min-h-[360px] bg-[#D9000D] text-white flex p-[10px] w-full mx-auto max-w-[250px] max-h-[360px] text-[white] bg-cover md:bg-center mx-[8px] md:bg-auto\">\n   <div class=\" flex justify-center flex-col items-center\">\n     <p class=\"text-center\" >\n     \n   <img src=\"/uploads/Hyderabad_d1fcd33a4a.png?updated_at=2022-10-06T04:59:38.437Z\" class=\"w-14\"/>\n     </p>\n     <p class=\"text-base font-semibold\">Hyderabad</p>\n   \n    <p class=\"text-xs mt-3\"><spam class=\"font-semibold mb-[5px] flex justify-center\">4 weekly special flights</spam>from Hyderabad are available every alternate day.</p>\n    </div>\n </a>\n <a href=\"https://content.airindia.in/promotions/maa-doh\" class=\"xs:max-w-[45%] min-h-[360px] bg-[#D9000D] text-white flex p-[10px] w-full mx-auto max-w-[250px] max-h-[360px] text-[white] bg-cover md:bg-center mx-[8px] md:bg-auto\">\n   <div class=\" flex justify-center flex-col items-center\">\n     <p class=\"text-center\" >\n     \n   <img src=\"/uploads/Chennai_82b4229d86.png?updated_at=2022-10-06T04:59:38.443Z\" class=\"w-14\"/>\n     </p>\n     <p class=\"text-base font-semibold\">Chennai</p>\n   \n    <p class=\"text-xs mt-3\"><spam class=\"font-semibold mb-[5px] flex justify-center\">3 weekly special flights</spam>from Chennai are available every alternate day. Travellers can check our Air India website for details.</p>\n    </div>\n </a>\n</div>\n<p class=\"max-w-4xl text-sm mx-auto\" style=\"margin-bottom:50px\">\nWe understand the needs of Indian travellers better than others. Hence, we have designed the flight schedules to facilitate and simplify the entire journey for you, making it possible to experience Air India\'s warm Indian hospitality and luxury.\n</p>\n            </div>','MUMBAI','BOM','Well fly you TO your goal.','Enjoy the new era of flying with our non-stop flights to Doha from key cities in India.  '),(4,'football promo','bom-doh','football, world cup',0,'\n<p>The Hamad International Airport plays a big hand in the tourism industry 11.\nWhether you\'re arriving or departing, the airport offers world-class comfort, dining, and shopping experience. \nThe airport has particularly been renovated to accommodate the rush of passengers for the upcoming tournament. </p>','2022-10-05 15:11:58.016000','2022-10-11 06:03:46.671000','2022-10-06 06:19:39.434000',1,5,'FOOTBALL FANS, ARE YOU READY?','  Football fans, be a part of the action in Qatar.\n          <br />\n          Air India is introducing 20 new flights to Qatar every week. We will\n          fly from metro cities that includes <br />\n          Mumbai, Delhi, Hyderabad, and Chennai. The new flights will cater to\n          the football craze amongst the <br />\n          fans during the months of November and December 2022. See you in Doha.','THE HAMAD INTERNATIONAL AIRPORT, DOHA','Fly with us','Air India has added 20 extra flights each week from major Indian cities, including Mumbai, Delhi, Hyderabad, and Chennai, to Doha, making it easier for Indians to travel to Qatar. You can now easily travel to Qatar to experience the events, activities, and culture that are taking place.\nThe additional flights will help meet the rising demand for flight tickets to Doha, an increasingly popular travel destination. Previously, we had increased the number of flights by 24 to boost connectivity to Doha.\n<br/> <br/>\nWe strive to provide impeccable travel and hospitality services to all travellers from India. The flight schedule is created to make the entire journey simple and convenient for travellers.\nIn addition to the daily flights running from Delhi, the additional flights will connect India\'s major cities like Mumbai, Delhi, Chennai, and Hyderabad with Qatar\'s capital, Doha.\n\n','MUMBAI','BOM','Well fly you to your goal.','Mumbai to Doha'),(5,'football promo','del-doh','football, world cup',0,'\n<p>The Hamad International Airport plays a big hand in the tourism industry 11.\nWhether you\'re arriving or departing, the airport offers world-class comfort, dining, and shopping experience. \nThe airport has particularly been renovated to accommodate the rush of passengers for the upcoming tournament. </p>','2022-10-06 05:26:00.568000','2022-10-11 06:07:06.118000','2022-10-06 05:26:03.086000',3,5,'FOOTBALL FANS, ARE YOU READY?','  Football fans,